//Routes
import Home from './home'
import About from './about'


//Components
import Layout from '../components/layout'
import Index from './index'

import '../style.scss'

const App = () => {
    return (


      <Provider store={store}>
          <Layout>
            <Link href="/">
                <Home/>
            </Link>
            <Link href="/about"><a>about</a></Link>
          </Layout>
      </Provider>
    )
}

export default App;
